import { useQuery } from '@tanstack/react-query';
import './App.css';

function App() {

  const { isPending, error, data } = useQuery({
    queryKey: ['repoData'],
    queryFn : ()=>{
      fetch(`https://jsonplaceholder.typicode.com/users`).then((res)=>res.json());
    }
  });

  if(isPending) return 'Loading...';

  if(error) return 'error...' + error;

  return (
    <div className="App">

    </div>
  );
}

export default App;
